import titulo from '../images/título.png';

class Header extends React.Component {
  render() {
    return (
      <header>
        <img src={ titulo } alt="imagem do título" className="tituloImg" />
        <button className='buttonTest' onClick={() => {
          const MissionsEl = document.getElementById(('MissionsId'));
          MissionsEl.scrollIntoView({behavior: 'auto'});
        }}>MISSIONS</button>
      </header>
    );
  }
}

export default Header;
